const Nav = ({nav}) => {

    const [isClicked, setClicked] = useState(false)

    const toggleNav = () => {
        (isClicked === false) ? (setClicked(true)) : (setClicked(false))
    }

    let classToggle = isClicked ? "openNav" : "closedNav"




    if (nav === "about"){
        return (
            <div id="navbarA" className={classToggle}>
                <div>

                </div>
                <div className="navItem icon">
                    <i class="far fa-eye" onClick={toggleNav}></i>
                </div>
                <div className="navItem item">
                    ABOUT
                </div>
                <div className="navItem item">
                    PROJECTS
                </div>
                <div className="navItem item">
                    CONTACT
                </div>
            </div>
        )
    } else {
        return (
            <div id="navbarB">
                <div>
                    <h1>MEIKA FRECKELTON</h1>

                </div>
                <div className={classToggle}>
                    <div className="navItem">
                        ABOUT
                    </div>
                    <div className="navItem">
                        PROJECTS
                    </div>
                    <div className="navItem">
                        CONTACT
                    </div>

                </div>
            </div>
        )
    }


